import React from 'react';

const Hamburger = () => {
    return(
        <div>
            <div className="hamburger-line top-line"></div>
            <div className="hamburger-line middle-line"></div>
            <div className="hamburger-line bottom-line"></div>
        </div>
    )
}

export default Hamburger;
